public class Test {
	
	public static void main(String[] args) {
		 String interfaceReturnContent = "";
		    try {
		      Service service = new Service();
		      String xmlns = "ITProblemReportService.util.opcollect.platform.eoms.boco.com";
		      System.out.println("xmlns名字："+xmlns);
		      Call call = (Call)service.createCall();
		      call.setOperationName(new QName(xmlns, "newSheet"));
		      call.setSOAPActionURI("");
		      call.addParameter(new QName(xmlns, "opDetail"), XMLType.XSD_STRING, ParameterMode.IN);
		      call.addParameter(new QName(xmlns, "attachRef"), XMLType.XSD_STRING, ParameterMode.IN);
		      call.setTargetEndpointAddress(new URL("http://10.210.6.49:9080/eoms35/services/ITProblemReportService?wsdl"));
		      call.setReturnType(XMLType.XSD_STRING);
		      call.setTimeout(Integer.valueOf(10000));
		      String opDetail="";
		      String attachRef="<attachRef><attachInfo><attachName>pic</attachName><attachURL><div><img alt='' src='data:image/jpeg;base64,' /></div></attachURL>	<attachLength>1024</attachLength></attachInfo></attachRef>";
		      System.out.println("*********字段报文:"+opDetail);
		      System.out.println("*********附件报文:"+attachRef);
		      
		      interfaceReturnContent = (String)call.invoke(new Object[] { opDetail, attachRef });
		      System.out.println(interfaceReturnContent);
		    } catch (Exception e) {
		      e.printStackTrace();
		      interfaceReturnContent = "interface error!" + e.getMessage();
		    }
	}

}
